/**
 * Repository ruleset
 * A set of rules to apply when specified conditions are met.
 */
interface RepositoryRuleset {
  /** The ID of the ruleset */
  id: number;
  /** The name of the ruleset */
  name: string;
  /** The target of the ruleset */
  target?: "branch" | "tag" | "push" | "repository";
  /** The type of the source of the ruleset */
  source_type?: "Repository" | "Organization" | "Enterprise";
  /** The name of the source */
  source: string;
  /** The enforcement level of the ruleset. `evaluate` allows admins to test rules before enforcing them. Admins can view insights on the Rule Insights page (`evaluate` is only available with GitHub Enterprise). */
  enforcement: RepositoryRuleEnforcement;
  /** The actors that can bypass the rules in this ruleset */
  bypass_actors?: RepositoryRulesetBypassActor[];
  /**
   * The bypass type of the user making the API request for this ruleset. This field is only returned when
   * querying the repository-level endpoint.
   */
  current_user_can_bypass?: "always" | "pull_requests_only" | "never";
  node_id?: string;
  _links?: {
    self?: {
      /** The URL of the ruleset */
      href?: string;
    };
    html?: {
      /** The html URL of the ruleset */
      href?: string;
    } | null;
  };
  conditions?: RepositoryRulesetConditions | OrgRulesetConditions | null;
  rules?: RepositoryRule[];
  /** @format date-time */
  created_at?: string;
  /** @format date-time */
  updated_at?: string;
}

/**
 * Rule Suites
 * Response
 */
type RuleSuites = {
  /** The unique identifier of the rule insight. */
  id?: number;
  /** The number that identifies the user. */
  actor_id?: number;
  /** The handle for the GitHub user account. */
  actor_name?: string;
  /** The first commit sha before the push evaluation. */
  before_sha?: string;
  /** The last commit sha in the push evaluation. */
  after_sha?: string;
  /** The ref name that the evaluation ran on. */
  ref?: string;
  /** The ID of the repository associated with the rule evaluation. */
  repository_id?: number;
  /** The name of the repository without the `.git` extension. */
  repository_name?: string;
  /**
   * @format date-time
   * @example "2011-01-26T19:06:43Z"
   */
  pushed_at?: string;
  /** The result of the rule evaluations for rules with the `active` enforcement status. */
  result?: "pass" | "fail" | "bypass";
  /** The result of the rule evaluations for rules with the `active` and `evaluate` enforcement statuses, demonstrating whether rules would pass or fail if all rules in the rule suite were `active`. */
  evaluation_result?: "pass" | "fail" | "bypass";
}[];

/**
 * Rule Suite
 * Response
 */
interface RuleSuite {
  /** The unique identifier of the rule insight. */
  id?: number;
  /** The number that identifies the user. */
  actor_id?: number | null;
  /** The handle for the GitHub user account. */
  actor_name?: string | null;
  /** The first commit sha before the push evaluation. */
  before_sha?: string;
  /** The last commit sha in the push evaluation. */
  after_sha?: string;
  /** The ref name that the evaluation ran on. */
  ref?: string;
  /** The ID of the repository associated with the rule evaluation. */
  repository_id?: number;
  /** The name of the repository without the `.git` extension. */
  repository_name?: string;
  /**
   * @format date-time
   * @example "2011-01-26T19:06:43Z"
   */
  pushed_at?: string;
  /** The result of the rule evaluations for rules with the `active` enforcement status. */
  result?: "pass" | "fail" | "bypass";
  /** The result of the rule evaluations for rules with the `active` and `evaluate` enforcement statuses, demonstrating whether rules would pass or fail if all rules in the rule suite were `active`. Null if no rules with `evaluate` enforcement status were run. */
  evaluation_result?: "pass" | "fail" | "bypass" | null;
  /** Details on the evaluated rules. */
  rule_evaluations?: {
    rule_source?: {
      /** The type of rule source. */
      type?: string;
      /** The ID of the rule source. */
      id?: number | null;
      /** The name of the rule source. */
      name?: string | null;
    };
    /** The enforcement level of this rule source. */
    enforcement?: "active" | "evaluate" | "deleted ruleset";
    /** The result of the evaluation of the individual rule. */
    result?: "pass" | "fail";
    /** The type of rule. */
    rule_type?: string;
    /** The detailed failure message for the rule. Null if the rule passed. */
    details?: string | null;
  }[];
}

