  /**
   * The name of the runner group to which this job has been assigned. (If a runner hasn't yet been assigned, this will be null.)
   * @example "my runner group"
   */
  runner_group_name: string | null;
  /**
   * The name of the workflow.
   * @example "Build"
   */
